import React, { Component } from 'react';
import NavBar from '../components/NavBar'
import 'bulma/css/bulma.css'

const styles = {
    backgroundImage: 'url(../../public/main-background.jpg)'
}

class HomePage extends Component {
    render() {
        return (
        <React.Fragment>
            <div><NavBar/></div>
            <img src={styles}></img>
        </React.Fragment>
        );
    }
}

export default HomePage;
